For this section we'll be using the example of a hypothetical 'fungible token' application where users can send tokens to each other. At the system-level, interacting with an application can be done via operations and effects. Operations are defined by an application developer and each application can have a completely different set of operations. Chain owners then actively create operations and put them in their block proposals to interact with an application. Using our hypothetical 'fungible token' application as an example, an operation for a user to transfer funds to another user would look like this: #[derive(Deserialize, Serialize)]
pub enum Operation { /// A transfer from a (locally owned) account to a (possibly remote) account. Transfer { owner: AccountOwner, amount: Amount, target_account: Account, }, // Meant to be extended here
} Effects are outcomes of execution (of operations or other effects). Effects from one chain can be sent in a cross-chain message to another. Block proposers also actively include effects in their block proposal, but unlike with operations, they are only allowed to include them in the right order (possibly skipping some), and only if they were actually created by another chain (or the same chain, earlier). In our 'fungible token' application, an effect to credit an account would look like this: #[derive(Deserialize, Serialize)]
pub enum Effect { Credit { owner: AccountOwner, amount: Amount }, // Meant to be extended here
}

