The Contract is the first component of your Linera application. It can actually change the state of the application. To create a contract, we need to implement the Contract trait, which is as follows: #[async_trait]
pub trait Contract: Sized { /// Message reports for application execution errors. type Error: Error; /// The desired storage backend to use to store the application's state. type Storage; /// Initializes the application on the chain that created it. async fn initialize( &mut self, context: &OperationContext, argument: &[u8], ) -> Result<ExecutionResult, Self::Error>; /// Applies an operation from the current block. async fn execute_operation( &mut self, context: &OperationContext, operation: &[u8], ) -> Result<ExecutionResult, Self::Error>; /// Applies an effect originating from a cross-chain message. async fn execute_effect( &mut self, context: &EffectContext, effect: &[u8], ) -> Result<ExecutionResult, Self::Error>; /// Handles a call from another application. async fn handle_application_call( &mut self, context: &CalleeContext, argument: &[u8], forwarded_sessions: Vec<SessionId>, ) -> Result<ApplicationCallResult, Self::Error>; /// Handles a call into a session created by this application. async fn handle_session_call( &mut self, context: &CalleeContext, session: Session, argument: &[u8], forwarded_sessions: Vec<SessionId>, ) -> Result<SessionCallResult, Self::Error>;
} There's quite a bit going on here, so let's break it down and take one method at a time. For this application, we'll be using the initialize and execute_operation command.

